import React from "react";
import BodyCity from "./BodyCity";

import styles from "./Body.module.css";

const Body = (props) => {
  return (
    <ul className={styles.body}>
      {props.dataCity.map((dataCity) => (
        <NavBarItem
          key={Math.random().toString()}
          type={dataCity.type}
          icon={dataCity.icon}
          active={dataCity.active}
        />
      ))}
    </ul>
  );
};

export default Body;
